def get_user_input():
    option = int(raw_input("There are several options you can choose in our tracker. They include\n 1.) Showing the number of cases and deaths across the U.S. counties in a single day\n 2.) Comparing the cases and mortalities in a single county\n 3.) Comparing the cases of 2 different counties\n 4.) Comparing the mortalities of 2 different counties\n 5.) Graphing the cases in a single county over time, or\n 6.) Graphing the mortalities in a single county over time\n Which would you like to do? Please select a number from 1 to 6. "))

    if option == 1:
        date = raw_input("Which day's data do you wish to select? Enter in the following numeric form: month/day/year, where months and days less than ten are represented with a zero before them. ")
        user_response = str(date).replace("/", "")
        all_counties(user_response)

    elif option == 2:
        user_response = int(raw_input("Select the county whose cases and mortalities you wish to track. "))
        one_state_cases_and_mortalities_comparison(user_response)

    elif option == 3:
        user_response_1 = int(raw_input("Select the first county whose cases you wish to compare. "))
        user_response_2 = int(raw_input("Select the second county whose cases you wish to compare. "))
        cases_comparison(user_response_1, user_response_2)

    elif option == 4:
        user_response_1 = int(raw_input("Select the first county whose mortalities you wish to compare. "))
        user_response_2 = int(raw_input("Select the second county whose mortalities you wish to compare. "))
        mortality_comparison(user_response_1, user_response_2)

    elif option ==5:
        user_response = int(raw_input("Choose the county whose cases you wish to graph. "))
        one_county_cases(user_response)
    
    elif option == 6:
        user_response = int(raw_input("Choose the county whose mortalities you wish to graph. "))
        one_county_mortalities(user_response)
        

def loop_program():
    print("Would you like to generate another chart (yes/no)?")
    response = raw_input()
    while True:
        if response.lower() == "yes":
            run_program()
        elif response.lower() == "no":
            print("Thank you for using our COVID-19 tracker!")
            sys.exit()
        else:
            print("Invalid response. Please try again.")
            response = raw_input()


